package frc.robot.commands.extensionarm;import edu.wpi.first.wpilibj2.command.CommandBase;import frc.robot.Constants;import frc.robot.subsystems.ExtensionArm;/** An example command that uses an example subsystem. */public class AutoZeroExtensionArm extends CommandBase {@SuppressWarnings({"PMD.UnusedPrivateField", "PMD.SingularField"})private final ExtensionArm m_extensionArm;/*** Creates a new ExampleCommand.** @param subsystem The subsystem used by this command.*/public AutoZeroExtensionArm(ExtensionArm subsystem) {m_extensionArm = subsystem;addRequirements(subsystem);}@Override public void initialize() {}@Override public void execute() {m_extensionArm.setSpeed(-.25);}@Override public void end(boolean interrupted) {m_extensionArm.stop();if (!interrupted) {m_extensionArm.resetEncoders();}m_extensionArm.setZeroed();}@Override public boolean isFinished() {return m_extensionArm.LimitSwitch();}}